INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 0.0, 24, 24015, 10021, 110501, "カオリ（サマー）", 4, "2030/12/17 14:59:59", 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 1, 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 0.0, 24, 24016, 10021, 110501, "カオリ（サマー）", 1, "2030/12/17 14:59:59", 4, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 2, 4.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 0.0, 24, 24017, 10021, 110501, "カオリ（サマー）", 4, "2030/12/17 14:59:59", 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 3, 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 0.0, 24, 24018, 10021, 110501, "カオリ（サマー）", 2, "2030/12/17 14:59:59", 1, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 4, 5.2);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 0.0, 24, 24019, 10021, 110501, "カオリ（サマー）", 6, "2030/12/17 14:59:59", 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 5, 4.2);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 0.0, 24, 24020, 10021, 110501, "カオリ（サマー）", 2, "2030/12/17 14:59:59", 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 6, 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 0.0, 24, 24021, 10021, 110501, "カオリ（サマー）", 6, "2030/12/17 14:59:59", 1, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 7, 6.4);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 0.0, 24, 24022, 10021, 110501, "カオリ（サマー）", 2, "2030/12/17 14:59:59", 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 8, 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 0.0, 24, 24023, 10021, 110501, "カオリ（サマー）", 3, "2030/12/17 14:59:59", 6, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 9, 10.08);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 0.0, 24, 24024, 10021, 110501, "カオリ（サマー）", 2, "2030/12/17 14:59:59", 1, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10, 5.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 0.0, 24, 24025, 10021, 110501, "カオリ（サマー）", 2, "2030/12/17 14:59:59", 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 11, 0.0);
